import React from 'react';

class Sites extends React.Component{
    render(){
        let sites = this.props.sites
        switch (sites) {
            case 'enable':
                sites = 'ON';
                break;
            case 'disable':
                sites = 'OFF';
                break;
            case 'blocked':
                sites = 'BLOCK';
                break;
        }
        return (
            <div>{this.props.sites}</div>
        )
    }
}



export default Sites;
